import React, { useEffect, useRef, useState } from 'react';
import './index.css';
import axios from 'axios';


    // The table component
const Table = () => {
    const [companies, setCompanies] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:5000/api/companies')
        .then((res) => {
            setCompanies(res.data);
        })
        .catch((err) => {
            console.log(err);
        });
    }, []);


    return (
        <table>
        <thead>
            <tr>
            <th> </th>
            <th>Company</th>
            <th>Applied</th>
            <th>Rejected</th>
            <th>OA</th>
            <th>Interview</th>
            <th>Final</th>
            <th>Offer</th>

            </tr>
        </thead>
        <tbody>
            {companies.map(row => (
            <tr>
                <td>{row.company}</td>
                <td>{row.applied}</td>
                <td>{row.rejected}</td>
                <td>{row.oa}</td>
                <td>{row.interview}</td>
                <td>{row.final}</td>
                <td>{row.offer}</td>
            </tr>
            ))}
        </tbody>
        </table>
    );
};

export default Table;
